const isUserExists = (state) => {
    console.log(state);
    return (
        state.loginState.userData.email === state.loginState.userFetchedData[0].email
    );
}

const getFetchError = ({ storyState }) => {
    return (
        storyState.error
    );
}

export { isUserExists, getFetchError }
